DELIMITER ;;
CREATE PROCEDURE `sp_verificar_estoque`()
BEGIN
    DECLARE done INT DEFAULT 0;
    DECLARE prod_id INT;
    DECLARE prod_nome VARCHAR(100);
    DECLARE prod_qtd INT;
    DECLARE prod_qtd_min INT;

    -- Cursor para todos os produtos
    DECLARE cur_prod CURSOR FOR 
        SELECT id_produto, nome, qtd, qtd_min 
        FROM produto;

    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = 1;

    OPEN cur_prod;

    read_loop: LOOP
        FETCH cur_prod INTO prod_id, prod_nome, prod_qtd, prod_qtd_min;
        IF done THEN
            LEAVE read_loop;
        END IF;

        -- Remove notificações antigas para este produto
        DELETE FROM notificacoes 
        WHERE mensagem LIKE CONCAT('Produto ', prod_nome, '%');

        -- Insere nova notificação dependendo do estoque
        IF prod_qtd = 0 THEN
            INSERT INTO notificacoes (id_usuario, mensagem, status, dt_criacao)
            VALUES (1, CONCAT('Produto ', prod_nome, ' está com estoque ZERADO'), 'A', NOW());
        ELSEIF prod_qtd < prod_qtd_min THEN
            INSERT INTO notificacoes (id_usuario, mensagem, status, dt_criacao)
            VALUES (1, CONCAT('Produto ', prod_nome, ' está abaixo do estoque mínimo'), 'A', NOW());
        END IF;

    END LOOP;

    CLOSE cur_prod;
END ;;
